(162, 'MHP0000162', 729, 64, '+968 95303373', 0, 'Red Cliffs Recreation Area', 88000, 6, 6, 11, '300', '', '', '', '507', 'Washington', 'Utah', 'United States', 'معلومات عن الفلل:\r\nتتكون الفله من حوش داخلي وخارجي مغطى ب الانتر لوك ب الكامل . مع توافر جميع الخدمات الماء والكهرباء والانترنت .\r\n\r\nمساحة البناء 327 لكل الفله والارض 300 و 290 \r\n\r\nالدور الاول يتكون من صاله مفتوحه بدورة مياه + غرفة خدامه بدورة مياه + مطبخ خارجي بمخزنه .\r\n\r\nالدور الثاني يتكون من ثلاث غرف بدورات مياه +صالة صغيرة +مخزنين .\r\n\r\nالدور الثالث يتكون من غرفتين بدورة مياه مشتركه .\r\n\r\nوهذا بناء شخصي ذو جودة ممتازة .\r\n\r\nاما اذا اردتم رأيت الفله ب الفيديو ف أرجو التواصل على الواتساب .\r\n\r\nللعلم الفلل بدون مجلس نظامها نظام اروبي \r\nوقابله لفصل الصاله لأجل المجلس لان الفكره موجود في مخطط البيت والفلل الخلفيه هي الاقرب والانسب للمجلس  .\r\n\r\nالسراميك اسباني + مطبخ مضمون 10 سنوات + ابواب تفصيل ام دي اف + النوافذ دبل جلاس بضمانها + الدرج جرانيت + الادوات الصحيه والكهربائيه ميلانو + بيبات الماء داخل وخارج المنزل تكنو + الوايرات الداخليه كابلات عمان + خزان الماء امانتيت عمان + الصبغ الخارجي ضد الغبار والامطار .\r\n\r\nفلل اماميه وهم عباره عن كونر \r\nالاولى تم البيع  \r\nالثانيه سعرها ب 88 الف قابل\r\n\r\nالخلفيات اسعارهم ب 84', 0, '', '37.2227123', '-113.4035717', 0, 0, 1, '2018-07-25 07:04:54', '0000-00-00 00:00:00'),
